public class JMCAAnalyzer implements Analyzer {

    public String analyze(ASTNode root) {
        if (root == null) {
            output.append("File did not parse correctly");
            return output.toString();
        }
        setHeader();
        //  for each class
        for (ASTNode node : root.list) {
            analyzeClass(node);
        }
        return output.toString();
    }
}

